    playbackData.comments = {"87358069-c25b-4d2c-9105-4c869455bf86":[{"id":"9968b09b-7a82-484c-a709-a28ef8c5a6fa","displayCommentEventId":"87358069-c25b-4d2c-9105-4c869455bf86","displayCommentEventSequenceNumber":0,"developerGroupId":"331293ce-e452-400a-befc-1ae9fa4d8e78","timestamp":1695782704716,"commentText":"In this code story, we'll explore the use of guards to determine whether a value appears in a list.&nbsp;<div><br></div><div>This code story is modeled after an example from Thomas VanDrunen's <a href=\"https://cs.wheaton.edu/~tvandrun/dmfp/\"><span style=\"font-style: italic;\">Discrete Mathematics and Functional Programming</span>.</a></div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"a1f21b36-e7c0-47a1-a8b1-c4cb5cb116c4":[{"id":"d62b7a2c-5430-498a-a86f-7c8637113e14","displayCommentEventId":"a1f21b36-e7c0-47a1-a8b1-c4cb5cb116c4","displayCommentEventSequenceNumber":343,"developerGroupId":"7fbf2280-a065-434f-a2e8-671b7b4268e5","timestamp":1695783235877,"commentText":"Suppose we want to write a function <span style=\"font-family: Courier;\">elemOfList</span> that will determine whether a value&nbsp;<span style=\"font-family: Courier;\">x</span>&nbsp;appears in a list. There are two base cases to account for:<div><br></div><div>1. If the list is empty, clearly the value is not in the list.</div><div><br></div><div>2. If the value is first in the list, then we have found it!<br><br>Otherwise, we recursively search the rest of the list.&nbsp;</div>","commentTitle":"First attempt: Pattern matching","position":0,"selectedCodeBlocks":[{"fileId":"4ce5173f-ae34-4965-807d-c2774f587214","selectedText":"elemOfList x Empty = False\nelemOfList x (Entry x _) = True\nelemOfList x (Entry y ys) = elemOfList x ys","startRow":11,"startColumn":0,"endRow":13,"endColumn":43}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"elemOfList x Empty = False\nelemOfList x (Entry x _) = True\nelemOfList x (Entry y ys) = elemOfList x ys","commentTags":[],"questionCommentData":null},{"id":"c707d464-a3ac-4d99-9521-c7823bd4cd77","displayCommentEventId":"a1f21b36-e7c0-47a1-a8b1-c4cb5cb116c4","displayCommentEventSequenceNumber":343,"developerGroupId":"7fbf2280-a065-434f-a2e8-671b7b4268e5","timestamp":1695783375655,"commentText":"<div>Unfortunately, when we try to compile this function, we get an error:<br><br><div><span style=\"font-family: Courier;\">Conflicting definitions for x</span></div></div><div><br></div><div>In the second case, our intention is that the <span style=\"font-style: italic;\">value</span>&nbsp;of the parameter <span style=\"font-family: Courier;\">x</span> should appear as the first value of the list.&nbsp; But instead, the Haskell compiler assumes we are trying to use pattern matching to bind two different values to the same name <span style=\"font-family: Courier;\">x</span>.</div>","commentTitle":"Conflicting definitions","position":1,"selectedCodeBlocks":[{"fileId":"4ce5173f-ae34-4965-807d-c2774f587214","selectedText":"elemOfList x (Entry x _) = True","startRow":12,"startColumn":0,"endRow":12,"endColumn":31}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"elemOfList x (Entry x _) = True","commentTags":[],"questionCommentData":null}],"8416fadf-1ee8-4e6e-b8d1-1b6fdb3c9844":[{"id":"66b4ddcc-1883-4f68-a119-023059f4ee89","displayCommentEventId":"8416fadf-1ee8-4e6e-b8d1-1b6fdb3c9844","displayCommentEventSequenceNumber":240,"developerGroupId":"7fbf2280-a065-434f-a2e8-671b7b4268e5","timestamp":1695783444095,"commentText":"We will begin with our own recursive definition of a <span style=\"font-family: Courier;\">List</span> datatype from the previous code story.","commentTitle":"Homemade lists","position":0,"selectedCodeBlocks":[{"fileId":"4ce5173f-ae34-4965-807d-c2774f587214","selectedText":"data List a = Empty | Entry a (List a)\n    deriving Show","startRow":2,"startColumn":0,"endRow":3,"endColumn":17}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"data List a = Empty | Entry a (List a)\n    deriving Show","commentTags":[],"questionCommentData":null}],"354804fd-9075-4736-bc0f-fecd9260ef22":[{"id":"f88356ff-b6bb-4e00-8482-a748cd6f4cad","displayCommentEventId":"354804fd-9075-4736-bc0f-fecd9260ef22","displayCommentEventSequenceNumber":455,"developerGroupId":"7fbf2280-a065-434f-a2e8-671b7b4268e5","timestamp":1695783670468,"commentText":"How can we fix this? Guards to the rescue!<div><br></div><div>We will have only two pattern matching cases: One for the empty list and one for a non-empty list.</div>","commentTitle":"Pattern matching cases","position":0,"selectedCodeBlocks":[{"fileId":"4ce5173f-ae34-4965-807d-c2774f587214","selectedText":"elemOfList x Empty = False\nelemOfList x (Entry y ys) ","startRow":11,"startColumn":0,"endRow":12,"endColumn":26}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"elemOfList x Empty = False\nelemOfList x (Entry y ys) ","commentTags":[],"questionCommentData":null},{"id":"82a3401e-b551-4258-9bc1-2cb18972301a","displayCommentEventId":"354804fd-9075-4736-bc0f-fecd9260ef22","displayCommentEventSequenceNumber":455,"developerGroupId":"7fbf2280-a065-434f-a2e8-671b7b4268e5","timestamp":1695783779312,"commentText":"In the non-empty list case, we will use guards to handle the two relevant cases.<div><br></div><div>If the first element of the list is equal to the target <span style=\"font-family: Courier;\">x</span>, then we return <span style=\"font-family: Courier;\">True</span>.</div><div><br></div><div>Otherwise, we search the rest of the list.</div>","commentTitle":"Guards","position":1,"selectedCodeBlocks":[{"fileId":"4ce5173f-ae34-4965-807d-c2774f587214","selectedText":"    | x == y    = True\n    | otherwise = elemOfList x ys","startRow":13,"startColumn":0,"endRow":14,"endColumn":33}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"    | x == y    = True\n    | otherwise = elemOfList x ys","commentTags":[],"questionCommentData":null}],"0686aa99-45d8-438d-96e5-0a30c25d1cdd":[{"id":"fb22e454-ff0d-4e88-ac92-3469c8ec0b7d","displayCommentEventId":"0686aa99-45d8-438d-96e5-0a30c25d1cdd","displayCommentEventSequenceNumber":490,"developerGroupId":"7fbf2280-a065-434f-a2e8-671b7b4268e5","timestamp":1695783984033,"commentText":"Let's test our function. Of course, 3 is an element of <span style=\"font-family: Courier;\">myList</span>, so this prints <span style=\"font-family: Courier;\">True</span>.","commentTitle":"Testing True","position":0,"selectedCodeBlocks":[{"fileId":"4ce5173f-ae34-4965-807d-c2774f587214","selectedText":"(elemOfList 3 myList)","startRow":0,"startColumn":22,"endRow":0,"endColumn":43}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"main = putStrLn (show (elemOfList 3 myList))","commentTags":[],"questionCommentData":null}],"0dff265e-11ed-45f0-9358-e2b5e23947a4":[{"id":"208b29b7-86ad-4a42-b8c2-89c5027d85cf","displayCommentEventId":"0dff265e-11ed-45f0-9358-e2b5e23947a4","displayCommentEventSequenceNumber":492,"developerGroupId":"7fbf2280-a065-434f-a2e8-671b7b4268e5","timestamp":1695784020441,"commentText":"And 7 is not an element of <span style=\"font-family: Courier;\">myList</span>, so this prints <span style=\"font-family: Courier;\">False</span>.","commentTitle":"Testing False","position":0,"selectedCodeBlocks":[{"fileId":"4ce5173f-ae34-4965-807d-c2774f587214","selectedText":"elemOfList 7 myList","startRow":0,"startColumn":23,"endRow":0,"endColumn":42}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"main = putStrLn (show (elemOfList 7 myList))","commentTags":[],"questionCommentData":null}],"ae533c19-6039-4cdb-8c69-3fc7ddbee09d":[{"id":"16955b95-e63a-4d02-ae43-b97045637e7b","displayCommentEventId":"ae533c19-6039-4cdb-8c69-3fc7ddbee09d","displayCommentEventSequenceNumber":538,"developerGroupId":"7fbf2280-a065-434f-a2e8-671b7b4268e5","timestamp":1695784239210,"commentText":"Last but not least, let's consider the function type. I asked the Haskell interpreter to do type inference for me by typing&nbsp;<div><br></div><div><span style=\"font-family: Courier;\">:t elemOfList</span></div><div><br></div><div>and this was the result.&nbsp;</div><div><br></div><div>Of course, the result is a <span style=\"font-family: Courier;\">Bool</span>. The two parameters are a value and a <span style=\"font-family: Courier;\">List</span> of the same type of value. That type must belong to the <span style=\"font-family: Courier;\">Eq</span> typeclass so that we can use the <span style=\"font-family: Courier;\">==</span> operator in the function definition.</div>","commentTitle":"Function type","position":0,"selectedCodeBlocks":[{"fileId":"4ce5173f-ae34-4965-807d-c2774f587214","selectedText":"elemOfList :: Eq t => t -> List t -> Bool\n","startRow":11,"startColumn":0,"endRow":12,"endColumn":0}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"elemOfList :: Eq t => t -> List t -> Bool\nelemOfList x Empty = False","commentTags":[],"questionCommentData":null}]};
